// export default GifList;
// src/components/GifList.js
import React from 'react';

function GifList({ gifs }) {
  return (
    <div className="gif-container">
      {gifs.map((gif) => (
        <img key={gif.id} src={gif.images.fixed_height.url} alt={gif.title} />
      ))}
    </div>
  );
}

export default GifList;
